import React, {Component} from 'react';
import {SafeAreaView, Text, View, StyleSheet, ImageBackground, TouchableOpacity
, Button} from 'react-native';
import { FontAwesome5 } from '@expo/vector-icons';

export default class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      nos: 0,
      eles: 0,
    };
    this.nos = 0;
    this.eles = 0;
  }

  somaNos (){
    this.setState({
      nos : this.nos + 1,
    });
    this.nos = this.nos + 1
  }

  somaEles (){
    this.setState({
      eles : this.eles + 1,
    });
    this.nos = this.nos + 1
  }

  somaNos_3 (){
    this.setState({
      nos : this.nos + 3,
    });
    this.nos = this.nos + 3
  }

  somaEles_3 (){
    this.setState({
      eles : this.eles + 3,
    });
    this.eles = this.eles + 3
  }

  subtraiNos (){
    this.setState({
      nos : this.nos - 1,
    });
    this.nos = this.nos - 1
  }

  subtraiEles (){
    this.setState({
      eles : this.eles - 1,
    });
    this.e = this.eles - 1
  }

  a (){
   alert('tste')
  }

  render(){
    return (
      <View style = {styles.D}>
        <Text style={styles.placar_nos}>Nós</Text>
        <Text style={styles.placar_eles}>Eles</Text>
        <Text style={styles.placar_pontosNos}>{this.state.nos}</Text>
        <Text style={styles.placar_pontosEles}>{this.state.eles}</Text>

          <View style = {styles.D2}>

            <TouchableOpacity onPress={ () => this.somaNos()}>
              <Text style={styles.botaoNos1}>+1</Text>
            </TouchableOpacity>

            <TouchableOpacity onPress={ () => this.somaNos_3()}>
              <Text style={styles.botaoNos3}>+3</Text>
            </TouchableOpacity>

            <TouchableOpacity onPress={ () => this.subtraiNos()}>
              <Text style={styles.botaoNosSub}>-1</Text>
            </TouchableOpacity>


            <TouchableOpacity onPress={ () => this.somaEles()}>
              <Text style={styles.botaoEles1}>+1 PRA ELES</Text>
            </TouchableOpacity>

            <TouchableOpacity onPress={ () => this.somaEles_3()}>
              <Text style={styles.botaoEles3}>+3 PRA ELES</Text>
            </TouchableOpacity>

            <TouchableOpacity onPress={ () => this.subtraiEles()}>
              <Text style={styles.botaoElesSub}>-1 PRA ELES</Text>
            </TouchableOpacity>

          </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  placar_nos:{
    color: 'skyblue',
    fontSize: 40,
    position: 'absolute',
    top: 20,
    right: 30
  },
  placar_eles:{
    color: 'tomato',
    fontSize: 40,
    position: 'absolute',
    top: 20,
    left: 30
  },
  placar_pontosEles:{
    color: 'black',
    fontSize: 40,
    position: 'absolute',
    top: 100,
    left: 50
  },
  placar_pontosNos:{
    color: 'black',
    fontSize: 40,
    position: 'absolute',
    top: 100,
    right: 50
  },


  botaoNos1:{
    position: 'absolute',
    right: 50,
    top: 110,
    fontSize: 35
  },
  botaoNos3:{
    position: 'absolute',
    right: 50,
    top: 210,
    fontSize: 35
  },
  botaoNosSub:{
    position: 'absolute',
    right: 50,
    top: 310,
    fontSize: 35,
  },


  botaoEles1:{
    position: 'absolute',
    left: 20,
    top: 110
  },
  botaoEles3:{
    position: 'absolute',
    left: 20,
    top: 150
  },
  botaoElesSub:{
    position: 'absolute',
    left: 20,
    top: 190
  },
  D:{
    marginVertical: '15%'
  },
  D2:{
    marginVertical: '45%'
  }
})
